CREATE TABLE hours(
   instant    INTEGER  NOT NULL PRIMARY KEY 
  ,dteday     DATE  NOT NULL
  ,season     INTEGER  NOT NULL
  ,yr         BIT  NOT NULL
  ,mnth       INTEGER  NOT NULL
  ,hr         INTEGER  NOT NULL
  ,holiday    BIT  NOT NULL
  ,weekday    INTEGER  NOT NULL
  ,workingday BIT  NOT NULL
  ,weathersit INTEGER  NOT NULL
  ,temp       NUMERIC(4,2) NOT NULL
  ,atemp      NUMERIC(6,4) NOT NULL
  ,hum        NUMERIC(4,2) NOT NULL
  ,windspeed  NUMERIC(6,4) NOT NULL
  ,casual     INTEGER  NOT NULL
  ,registered INTEGER  NOT NULL
  ,cnt        INTEGER  NOT NULL
);
